static inline void jsfuck_num(const uint8_t n, jsfuck_t *s)
{
    _jsfuck_stream_push(s, jsfucked_nums[n].string, jsfucked_nums[n].len);
}

static void jsfuck_custom(const int c, jsfuck_t *s)
{
    jsfuck_stream_push(s, JSFUCK_CUSTOM_PREFIX);

    char str[5];
    sprintf(str, "%d", (int)c);

    int8_t i = -1;

jsfuck_custom_loop:
    i++;
    jsfuck_num(str[i] - '0', s);

    if (i <= sizeof(str) && str[i + 1])
    {
        jsfuck_stream_push(s, "+");
        goto jsfuck_custom_loop;
    }

    jsfuck_stream_push(s, ")");
}

void jsfuck_get(const char c, jsfuck_t *s)
{
    if (c <= 0x1F || c >= 0x7F)
    {
        jsfuck_custom(c, s);
    }
    else if (c >= '0' && c <= '9')
    {
        jsfuck_num(c - '0', s);
        jsfuck_stream_push(s, "[]");
    }
    else if (c >= 32 && c <= 47)
    {
        _jsfuck_stream_push(s, jsfucked_crap_first[c - 32].string, jsfucked_crap_first[c - 32].len);
    }
    else if (c <= 126)
    {
        _jsfuck_stream_push(s, jsfucked_crap_last[c - 58].string, jsfucked_crap_last[c - 58].len);
    }
}